(function() {
	var userID = current.owner;
	return getVP(userID); // Get VP (or one level before SVP+)

	function getVP(sys_id) {
		var SVP_AND_ABOVE = 1,
			previous = new GlideRecord('sys_user'),
			current = new GlideRecord('sys_user');

		current.get(sys_id);

		while (current.sys_id && current.u_version_number != SVP_AND_ABOVE && current.manager != '') {
			previous.get(current.sys_id);
			current.get(previous.manager);
		}

		if (current.manager == '' || current.u_version_number != 1) {
			return current.sys_id;
		} 
		return previous.sys_id;
	}	
}());

